INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
	(1, '<ul class="sf-menu sf-js-enabled sf-arrows">\r\n                                <li class="current"><a href="index.html"><span class="fa fa-home"></span>Trang chủ</a></li>\r\n                                <li><a href="index-1.html"><span class="fa fa-plane"></span>Flights</a></li>\r\n                                <li><a href="index-2.html"><span class="fa fa-star"></span>Cars</a></li>\r\n                                <li><a href="index-3.html"><span class="fa fa-flag"></span>Lodging</a></li>\r\n                                <li><a href="index-4.html" class="sf-with-ul"><span class="fa fa-bell"></span>Cruises <strong></strong></a>\r\n                                    <ul class="sub-menu" style="display: none;">\r\n                                        <li><a href="#">Vestibulum iaculis</a></li>\r\n                                        <li><a href="#">Lacinia est</a></li>\r\n                                        <li><a href="#">Proin dictum </a></li>\r\n                                        <li><a href="#" class="sf-with-ul">Elementum velit</a>\r\n                                            <ul class="sub-menu" style="display: none;">\r\n                                                <li><a href="#">Dolore ipsu</a></li>\r\n                                                <li><a href="#">Consecte</a></li>\r\n                                                <li><a href="#">Elit Conseq</a></li>\r\n                                            </ul>\r\n                                        </li>\r\n                                        <li><a href="#">Consequat ante</a></li>\r\n                                    </ul>\r\n                                </li>\r\n                                <li><a href="index-5.html"><span class="fa fa-heart"></span>Vacations</a></li>\r\n                                <li><a href="index-6.html"><span class="fa fa-user"></span>Insurance</a></li>\r\n                            </ul>', 'Menu block', 'full_html'),
	(2, '<div class="title">the destination <span>of your Dreams</span></div> \r\n                <span class="sub">is just a click away</span>\r\n                <div class="clear"></div>\r\n                <form id="bookingForm">\r\n                    <div class="sect1">\r\n                        <div class="count"><span class="col1">01.</span> What?</div>\r\n                        <div class="controlHolder"><div class="tmRadio">\r\n                                <div class="lf">\r\n                                    <input name="Hotel" type="radio" data-constraints="@RadioGroupChecked(name=&quot;Hotel&quot;, groups=[RadioGroup])" checked="" id="regula-generated-720138" style="display: none;"><strong class="checked"></strong>\r\n                                    <span>Hotel</span>\r\n                                    <div class="clear"></div>\r\n                                    <input name="Hotel" type="radio" data-constraints="@RadioGroupChecked(name=&quot;Hotel&quot;, groups=[RadioGroup])" id="regula-generated-437629" style="display: none;"><strong class="unchecked"></strong>\r\n                                    <span>Flight</span>\r\n                                    <div class="clear"></div>\r\n                                    <input name="Hotel" type="radio" data-constraints="@RadioGroupChecked(name=&quot;Hotel&quot;, groups=[RadioGroup])" id="regula-generated-29407" style="display: none;"><strong class="unchecked"></strong>\r\n                                    <span>Flight + Hotel</span>\r\n\r\n                                </div>\r\n                                <div class="rf">\r\n                                    <input name="Hotel" type="radio" data-constraints="@RadioGroupChecked(name=&quot;Hotel&quot;, groups=[RadioGroup])" id="regula-generated-209086" style="display: none;"><strong class="unchecked"></strong>\r\n                                    <span>Flight + Hotel + Car</span>\r\n                                    <div class="clear"></div>\r\n                                    <input name="Hotel" type="radio" data-constraints="@RadioGroupChecked(name=&quot;Hotel&quot;, groups=[RadioGroup])" id="regula-generated-110692" style="display: none;"><strong class="unchecked"></strong>\r\n                                    <span>Cruise</span>\r\n                                    <div class="clear"></div>\r\n                                    <input name="Hotel" type="radio" data-constraints="@RadioGroupChecked(name=&quot;Hotel&quot;, groups=[RadioGroup])" id="regula-generated-798488" style="display: none;"><strong class="unchecked"></strong>\r\n                                    <span>Rent a Car</span>\r\n                                </div>\r\n                            </div></div>\r\n                    </div>\r\n                    <div class="sect2">\r\n\r\n                        <div class="count">\r\n                            <span class="col1">02.</span> Where?\r\n                        </div>\r\n                        <div class="controlHolder"><div class="tmInput">\r\n                                <span>Destination</span>\r\n                                <input name="Destination" placeholder="" type="text" data-constraints="@NotEmpty @Required" id="regula-generated-921694">\r\n                            </div></div>\r\n                        <div class="controlHolder"><div class="tmInput ">\r\n                                <span>Your e -mail</span>\r\n                                <input name="Hotel" placeholder="" type="text" data-constraints="@NotEmpty @Required @Email" id="regula-generated-468256">\r\n                            </div></div>\r\n                    </div>\r\n                    <div class="sect2">\r\n                        <div class="count"><span class="col1">03.</span> When?</div>\r\n\r\n                        <div class="controlHolder"><label class="tmDatepicker">\r\n                                <span>Check-in date</span>\r\n                                <input type="text" name="Check-in" placeholder="10/05/2014" data-constraints="@NotEmpty @Required @Date" id="dp1476105599685" class="hasDatepicker">\r\n                            </label></div>\r\n\r\n                        <div class="controlHolder"><label class="tmDatepicker">\r\n                                <span>Check-out date</span>\r\n                                <input type="text" name="Check-out" placeholder="20/05/2014" data-constraints="@NotEmpty @Required @Date" id="dp1476105599686" class="hasDatepicker">\r\n                            </label></div>\r\n                        <div class="clear"></div>\r\n                    </div>\r\n\r\n                    <div class="sect3">\r\n\r\n                        <div class="count">\r\n                            <span class="col1">04.</span> Who?\r\n                        </div>\r\n                        <div class="inn1">\r\n                            <span>Rooms</span>\r\n                            <div class="controlHolder"><select name="Rooms" class="tmSelect auto" data-class="tmSelect tmSelect2" data-constraints="" style="display: none;">\r\n                                    <option>&nbsp;</option>\r\n                                    <option>1</option>\r\n                                    <option>2</option>\r\n                                    <option>3</option>\r\n                                </select><ul class="tmSelect tmSelect2 auto trans-element"><li><span>&nbsp;</span><ul style="display: none;" class="transformSelectDropdown"><li data-settings="" class=""><span>1</span></li><li data-settings="" class=""><span>2</span></li><li data-settings="" class=""><span>3</span></li></ul></li></ul></div>\r\n                        </div>\r\n                        <div class="inn1">\r\n                            <span>Adults</span>\r\n                            <div class="controlHolder"><select name="Adults" class="tmSelect auto" data-class="tmSelect tmSelect2" data-constraints="" style="display: none;">\r\n                                    <option>&nbsp;</option>\r\n                                    <option>1</option>\r\n                                    <option>2</option>\r\n                                    <option>3</option>\r\n                                </select><ul class="tmSelect tmSelect2 auto trans-element"><li><span>&nbsp;</span><ul style="display: none;" class="transformSelectDropdown"><li data-settings="" class=""><span>1</span></li><li data-settings="" class=""><span>2</span></li><li data-settings="" class=""><span>3</span></li></ul></li></ul></div>\r\n\r\n                        </div>\r\n                        <div class="inn1">\r\n                            <span>Children</span>\r\n                            <div class="controlHolder"><select name="Children" class="tmSelect auto" data-class="tmSelect tmSelect2" data-constraints="" style="display: none;">\r\n                                    <option>&nbsp;</option>\r\n                                    <option>0</option>\r\n                                    <option>1</option>\r\n                                    <option>2</option>\r\n                                </select><ul class="tmSelect tmSelect2 auto trans-element"><li><span>&nbsp;</span><ul style="display: none;" class="transformSelectDropdown"><li data-settings="" class=""><span>0</span></li><li data-settings="" class=""><span>1</span></li><li data-settings="" class=""><span>2</span></li></ul></li></ul></div>\r\n                        </div>\r\n                    </div>\r\n                    <div class="clear"></div>\r\n                    <a href="#" class="subm" data-type="submit">Send a request</a>\r\n                    <div class="clear"></div>\r\n                </form>', 'hightlight', 'full_html'),
	(3, '<h2>Why Book With Us?<span class="col1">Praesent justo dolor, lobortis quis, lobortis dignissim, pulvinar ac, lorem</span>\r\n                </h2>\r\n<div class="grid_4">\r\n                <div class="prop">\r\n                    <div class="maxheight" style="height: 96px;">\r\n                        <div class="box_inner">\r\n                            <div class="fa fa-trophy"></div>\r\n                            <div class="title">Best Price Guarantee</div>\r\n                            <p>Find our lowest price to destinations worldwide, guaranteed</p>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div class="grid_4">\r\n                <div class="prop pp1">\r\n                    <div class="maxheight" style="height: 96px;">\r\n                        <div class="box_inner">\r\n                            <div class="fa fa-book"></div>\r\n                            <div class="title">Easy Booking</div>\r\n                            <p>Search, select and save - the fastest way to book your trip</p>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div class="grid_4">\r\n                <div class="prop pp2">\r\n                    <div class="maxheight" style="height: 96px;">\r\n                        <div class="box_inner">\r\n                            <div class="fa fa-comments"></div>\r\n                            <div class="title">24/7 Customer Care</div>\r\n                            <p>Get booking assistance and special deals by calling +1 800 889 9898 </p>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>', 'content top', 'full_html'),
	(4, '<div class="copy"><span class="f_logo"><a href="/">An Gia Phat</a></span> © <span id="copyright-year">2016</span> \r\n                </div>', 'footer', 'full_html'),
