	('node', 'product', 0, 6, 6, 'und', 0, 'Ngày 1 : TP.HỒ CHÍ MINH - BALI: (Ăn tối)\r\n\r\nXe và hướng dẫn viên Vietravel đón khách tại điểm hẹn Ga đi Quốc tế sân bay Tân Sơn Nhất, khởi hành ra phi trường đón chuyến bay đến Singapore, tiếp tục nối chuyến đến Bali .Đến sân bay quốc tế Bali, xe và hướng dẫn viên địa phương đón và đưa đoàn về nhận phòng tại khách sạn 4 sao. Đoàn dùng bữa tối tại nhà hàng địa phương, tự do nghỉ ngơi và khám phá đảo Bali về đêm.\r\n\r\nNgày 2 : BALI (Ăn ba bữa)\r\n\r\nĐoàn dùng bữa sáng tại khách sạn. Xe đưa Quý khách tham quan vẻ đẹp muôn màu tại đảo Bali. Quý khách sẽ được hòa mình vào điệu nhảy truyền thống Barong-Kis tại làng Batubulan - điệu vũ mô tả cuộc chiến bất tận giữa cái thiện và cái ác, thể hiện khát vọng hướng tới cuộc sống tươi đẹp hơn người dân Bali. Sau chương trình biểu diễn, Quý khách tiếp tục tham quan Đền Thờ Hoàng Gia Mengwi - Được xây dựng năm 1634 bởi vua của triều Mengwi, ngôi đền được xây dựng với lối kiến trúc độc đáo, mang đậm linh hôn của đảo Bali. Sau khi ăn trưa, Quý khách tham quan Đền Tanah Lot, ngôi đền tôn nghiêm nằm trên mỏm đá chót vót giữa biển khơi. Đền được xây vào khoảng thế kỷ XVI bởi những thầy tu cuối cùng đến Bali từ đảo Java, đền được dựng lên để bày tỏ lòng kính trọng của con người đối với sự che chở của Biển. Ăn tối tại nhà hàng địa phương, xe đưa Quý khách trở về khách sạn nghỉ ngơi.\r\n\r\nNgày 3 : ĐẢO LEMBONGAN (Ăn ba bữa)\r\n\r\nĂn sáng tại khách sạn. Khởi hành lên du thuyền để chiêm ngưỡng vẻ đẹp quyến rũ của hòn đảo nhiệt đới thanh bình. Sau khi đến đảo Lembongan, Quý khách sẽ được đưa tới Beach Club. Tại đây Quý khách có thể thư giản trên bãi cát vàng đầy nắng hoặc dưới bóng mát của những khu vườn cây yên tĩnh hay đắm mình trong làn nước mát lạnh trong xanh của khu hồ bơi. Nếu thích sự sôi nổi các bạn có thể  tham gia một số hoạt động ngoài trời như bóng chuyền bãi biển, chèo thuyền quả chuối, tàu cánh ngầm, lặn biển và du ngoạn khám phá hòn đảo xinh đẹp này (một số trò chơi chi phí tự túc). Và để tận hưởng thêm khí hậu nhiệt đới ấm áp tại đây, Quý khách sẽ thưởng thức buổi tiệc nướng BBQ hấp dẫn với các món ăn quốc tế như salad các loại, xúc xích và cá tươi được nướng ngay bên cạnh hồ bơi. Sau khi quay về lại cảng Bali và dùng cơm tối tại nhà hàng địa phương, trở về khách sạn nghỉ ngơi thư giãn.\r\n\r\nNgày 4 : BALI - SINGAPORE - TP.HỒ CHÍ MINH: (Ăn sáng)\r\n\r\nĂn sáng tại khách sạn. Quý khách tự do nghỉ ngơi hoặc mua sắm cho đến giờ khởi hành ra phi trường đón chuyến bay về lại TP.HCM (quá cảnh tại Singapore). Về đến sân bay Tân Sơn Nhất. Hướng dẫn viên Vietravel chia tay hẹn gặp lại đoàn. Kết thúc chuyến tham quan\r\n\r\n\r\n\r\nXem nội dung đầy đủ tại: https://travel.com.vn/tourNNSGN300-015-2610163K/bali-khach-san-4-sao-chuong-trinh-tri-an-khach-hang.aspx\r\nNguồn: travel.com.vn', '', 'filtered_html'),
	('node', 'product', 0, 7, 7, 'und', 0, 'Ngày 1 : TP.HỒ CHÍ MINH - PHNOM PENH - SIHANNOUKVILLE: (Ăn ba bữa)\r\n\r\nXe và hướng dẫn viên Vietravel đón Quý khách tại 190 Pasteur, Q.3, TP.HCM, khởi hành đến cửa khẩu Mộc Bài. Ăn sáng trên đường. Đến Mộc Bài, Quý khách làm thủ tục qua cửa khẩu. Xe và hướng dẫn viên địa phương đón đoàn và đưa đi dùng bữa trưa tại nhà hàng địa phương. Sau đó, Quý khách tiếp tục lên đường đi Sihanoukville - thành phố biển hàng đầu của Campuchia. Những bãi biển cát trắng, những dòng nước ấm áp từ Vịnh Thái Lan kết hợp với bầu không khí biển dể chịu đã tạo nên một địa điểm du lịch giúp du khách tránh cái nóng của khí hậu nhiệt đới. Đến nơi, Quý khách tham quan Tượng Sư Tử Vàng - biểu tượng của thành phố Sihanoukville sau đó tự do tắm biển tại bãi biển O Chheu Teal với sóng biển rì rào bên bãi cát trắng mịn màng. Dùng bữa tối, nhận phòng khách sạn nghỉ ngơi hoặc tự do khám phá biển đêm với những dãy quán bar nhộn nhịp dọc bờ biển và thưởng thức các loại hải sản tươi ngon (chi phí tự túc). \r\n\r\nNgày 2 : SIHANOUKVILLE - ĐẢO KOH RONG SAMLOEM: (Ăn ba bữa)\r\n\r\nQuý khách ăn sáng tại khách sạn. Khởi hành đi Đảo Kohrong Samloem - hòn đảo được mệnh danh là  “thiên đường bị bỏ quên” với biển xanh trong vắt, cát trắng mịn màng kết hợp cùng vẻ đẹp hoang sơ của rừng cây và động vật trên đảo.Quý khách tự do khám phá hòn đảo xinh đẹp và thơ mộng cũng như hòa mình trong làn nước trong mát với làn sóng êm đềm và bờ cát trắng trải dài, từ trên bờ Quý khách có thể bắt gặp từng đàn cá bơi lội. Quý khách đừng quên mang theo máy ảnh để có những shoot hình lãng mạn và đẹp nhất.Quý khách ăn trưa buffet trên tàu hoặc tại nhà hàng địa Phương (tùy theo loại tàu ra đảo).\r\n \r\nSau chuyến tham quan, tàu đưa Quý khách về bến cảng, về khách sạn để nghỉ ngơi. Tự do khám phá biển Sihanouville về đêm. Ăn tồi tại nhà hàng địa phương.\r\n**TỪ THÁNG 6->THÁNG 08 TÙY TÌNH HÌNH THỜI TIẾT,TRƯỜNG HỢP KHÔNG THAM QUAN ĐẢO QUÝ KHÁCH SẼ TỰ DO TẮM BIỂN SIHANOUK VILLE.\r\n\r\nNgày 3 : SIHANOUKVILLE - PHNOM PENH: (Ăn ba bữa)\r\n\r\nĂn sáng tại khách sạn. Xe đưa Quý khởi hành về lại Phnom Penh. Ăn trưa tại nhà hàng địa phương. Đến Phnom Penh - Thủ đô của Vương quốc Campuchia. Quý khách dùng bữa trưa tại nhà hàng địa phương. Buổi chiều, Quý khách đi tham quan Wat Phnom - Một ngôi chùa rất nổi tiếng tại thành phố Phnom Penh, tiếp tục tham quan Chùa Bạc và Hoàng Cung, Sông Bốn Mặt, ngắm nhìn Đài Độc Lập. Sau đó, Quý khách tự do tham quan và mua sắm tại City Jewelry.  Sau bữa tối, nhận phòng khách sạn nghỉ ngơi. Tự do khám phá Phnom Penh về dêm.\r\n\r\nNgày 4 : PHNOM PENH - MỘC BÀI - TP.HỒ CHÍ MINH: (Ăn sáng, ăn trưa)\r\n\r\nĂn sáng tại khách sạn. Quý khách tự đo mua sắm tại Central Market. Sau đó khởi hành về cửa khẩu Mộc Bài. Ăn trưa tại địa phương. Đến cửa khẩu Mộc Bài sau khi làm thủ tục nhập cảnh Việt Nam, xe Vietravel đưa Quý khách về lại 190 Pasteur, Q.3, TP.HCM. Kết thúc chuyến tham quan.\r\n\r\nXem nội dung đầy đủ tại: https://travel.com.vn/tourNNSGN104-087-271016XE/sihanouk-ville-koh-rong-samloem-phnom-penh-khach-san-3sao.aspx\r\nNguồn: travel.com.vn', '', 'full_html'),
	('node', 'product', 0, 8, 8, 'und', 0, 'Ngày 1 : Tp. Hồ Chí Minh - Trương Gia Giới\r\n\r\nHướng dẫn viên Công ty Vietravel đón Quý khách tại phi trường Tân Sơn Nhất đáp chuyến bay đi Trương Gia Giới  (quá cảnh tại Quảng Châu). Đến Trương Gia Giới, xe và Hướng dẫn viên đón tại sân bay. Sau đó về khách sạn tiêu chuẩn 3* nhận phòng và nghỉ ngơi.\r\n\r\nNgày 2 : Trương Gia Giới - Thành cổ Phượng Hoàng (Ăn ba bữa)\r\n\r\nSau khi ăn sáng tại khách sạn, Quý khách khởi hành đi thành cổ Phượng Hoàng bằng xe (mất khoảng 3.5 tiếng) - được nhà văn Tân Tây Lan Alley Rewi khen ngợi là nơi đẹp nhất Trung Quốc, là một thành cổ nhỏ bé nằm ở tỉnh Hồ Nam - Trung Quốc, với những ngôi nhà cổ áp sát vào núi và soi mình xuống dòng Đà Giang. Tham quan nhà cũ của nhà văn Thẩm Tùng Văn , nhà của Hùng Hy Linh - tổng bí thư đầu tiên của Trung Quốc, Thành lầu Đông Môn , Sùng Đức Đường , đền thờ nhà Dương , Vạn Thọ Cung và phố Minh Thanh , tường thành cổ, quảng trường Thẩm Tùng Văn , đi dạo dọc sông Đà Giang... Tối tự do ngắm cảnh đêm và dạo phố. Nghỉ đêm tại Phượng Hoàng.\r\n\r\nNgày 3 : Thành cổ Phượng Hoàng - Cát Thủ (Thành cổ Càn Châu) - Trương Gia Giới (Ăn ba bữa)\r\n\r\nSau khi ăn sáng tại khách sạn, xe và hướng dẫn viên đưa khách đi Cát Thủ (khoảng 1 tiếng đi xe) . Trên đường ngắm nhìn cảnh thiên nhiên miền Tây Hồ Nam. Đến nơi, tham quan Thành Cổ Càn Châu với những dấu ấn kiến trúc mang đậm dấu ấn của hai dân tộc chính là Thổ Gia và dân tộc Miêu… Sau đó quay về Trương Gia Giới (khoảng 3 tiếng rưỡi đi xe). Tham quan Viện Bảo Tàng tranh Quan Thanh - Tranh nghệ thuật sinh thái độc nhất vô nhị “trên thế giới chỉ Trung Quốc mới có - ở Trung Quốc thì chỉ Hồ Nam mới có - Ở Hồ Nam rộng lớn thì duy nhất Trương Gia Giới là có”. Tham quan Cửa hàng thuốc Bắc và cửa hàng trà. Sau khi ăn tối, đoàn về nhận phòng khách sạn và nghỉ ngơi.\r\n\r\nNgày 4 : Trương Gia Giới (Ăn ba bữa)\r\n\r\nSau khi ăn sáng tại khách sạn, xe và hướng dẫn viên đưa khách đi Thiên Môn Sơn nằm trong vườn quốc gia Núi Thiên Môn,Trương Gia Giới, ở tây bắc tỉnh Hồ Nam, Trung Quốc. Ngọn núi này rất nổi tiếng với con đường trên trời và hệ thống cáp treo tại Thiên Môn được tuyên bố trong các ấn phẩm du lịch là "cáp treo dài nhất tại một ngọn núi cao nhất trên thế giới” với 98 cabin cáp treo và tổng chiều dài lên tới hơn 7.400 mét, độ cao của ga trên của tuyến cáp treo là 1.279 mét. (1 lượt cáp treo lên).\r\n\r\nKhi lên tới đỉnh của Thiên Môn Sơn, quý khách sẽ đi theo con đường bao quanh những đỉnh núi, xuyên từ đỉnh núi này sang đỉnh núi khác. Một bên là núi, một bên là mây, thỉnh thoảng có thêm những lá bùa may mắn màu đỏ rực rỡ sẽ khiến quý khách cảm thấy lạc như lạc vào chốn bồng lai tiên cảnh, như đang đi trên 9 tầng mây của thiên đường. Tiếp tục, quý khách vượt qua 999 bậc thang thẳng đứng để lên đến Cổng Trời - nơi giao thoa giữa trời và đất. Trải nghiệm đường kính ven vách núi độc đáo.\r\n\r\nĐoàn ăn trưa trên núi, sau đó tham quan Đại Hiệp Cốc – Kim Tiên Khê, nơi được mệnh danh là phố tình nhân đẹp nhất Trung Quốc. Quý khách ghé thăm quan các cảnh ven đường như Kim Tiên Nham, Tử Thảo Đàm, Phách Sơn Cứu Mẫu, Bảo Liên Đăng, Thiên Lý Tương Hội, Thủy Nhiễu Tứ Môn,…  mua sắm tại cửa hàng tơ lụa và cửa hàng vàng bạc đá quý. Sau khi ăn tối về khách sạn tại Võ Lăng Nguyên nghỉ ngơi.\r\n\r\nNgày 5 : Trương Gia Giới	(Ăn ba bữa)\r\n\r\nĂn sáng tại khách sạn, xe đưa đoàn khởi hành đến tham quan Khu bảo tồn quốc gia Trương Gia Giới (Viên Gia Giới)  nằm ở phía Tây Bắc của tỉnh Hồ Nam, Trung Quốc. Tại đây có tới hơn 3.000 cột đá và vách núi hình thù thiên biến vạn hóa, có cột cao tới 800 m. Quý khách chinh phục Trương Gia Giới bằng cách sử dụng Thang máy Bách Long Thiên – “thang máy ngoài trời cao nhất thế giới” để lên đinh núi cao hơn 320m, đến khu vực gọi là Mê Hồn Đài ngắm nhìn toàn bộ cảnh sắc nơi đây. Đặt biệt là ngọn núi Hallelujah – “Cột trụ trời Nam” được đạo diễn lừng danh Hollywood James Cameron lấy làm nguyên bản trong siêu phẩm điện ảnh Avatar (2009). Cột trụ này cao 1.080m, đầu năm 2010 được đổi tên thành "Avatar Hallelujah". Tiếp tục đến với “Thiên hạ đệ nhất Kiều” – nơi các cặp tình nhân dùng ổ khoá tình yêu khoá lại trên thành cầu sau đó quăng chìa khoá xuống vực, người ta tin rằng các cặp đôi làm như vậy sẽ mãi mãi hạnh phúc bên nhau. Tiếp tục đi khu phong cảnh Thiên Tử Sơn , là vùng núi đá độc đáo được hình thành trong quá trình đứt gãy và kiến tạo của địa chất. Lên tới đỉnh, đoàn có thể ngắm cảnh đẹp của núi non hùng vĩ như: Ngự Bút Phong, Tiên Nữ Tán Hoa, Thạch Phàm Xuất Hải... Đi cáp treo xuống đoàn tham quan hành lang nghệ thuật Thập Lý (đi và về bằng tàu hoả nhỏ). Về ăn tối tại nhà hàng địa phương, nhận phòng khách sạn. Nghỉ đêm tại Trương Gia Giới.\r\n\r\n*** Lưu ý: Khi tham quan lượt đi và về bằng tàu hoả nhỏ.\r\n\r\nNgày 6 : Trương Gia Giới - Quảng Châu - Hồ Chí Minh (Ăn sáng, trưa)\r\n\r\nSau khi ăn sáng tại khách sạn. Đoàn ra sân bay đáp chuyến bay về lại TP. Hồ Chí Minh (Quá cảnh Quảng Châu). Về đến Sân bay Tân Sơn Nhất. Hướng dẫn viên Vietravel tạm biệt Quý khách. Kết thúc chuyến tham quan.', '', 'full_html'),
	('node', 'product', 0, 9, 9, 'und', 0, 'Đến với "Đất Nước Mặt Trời Mọc" hứa hẹn sẽ mang lại cho Quý khách nhiều cơ hội tìm hiểu về văn hóa, thiên nhiên và con người Nhật Bản. Chương trình sẽ đưa Quý khách chiêm ngưỡng cảnh đẹp Nhật Bản từ Núi Phú Sĩ hùng vĩ, du ngoạn trên Hồ Ashi thơ mộng trữ tình. Đến với Cố Đô Kyoto chiêm ngưỡng kiệt tác Đền Vàng tuyệt đẹp rực rỡ giữa mặt hồ màu ngọc bích. Đặc biệt trong chương trình của Vietravel, Quý khách còn được thưởng thức ẩm thực Nhật Bản với món bò Kobe trứ danh, khám phá tàu siêu cao tốc Shinkansen, thư giãn trong phòng tắm Onsen truyền thống Nhật Bản là những trải nghiệm không thể bỏ lỡ khi đến với đất nước xinh đẹp này.\r\n', '', 'filtered_html'),
	('node', 'article', 0, 10, 10, 'und', 0, 'Không chỉ tự hào là miền đất địa linh nhân kiệt, quê hương của nhiều anh hùng lừng danh, Quy Nhơn còn quyến rũ bởi vẻ đẹp hoang sơ của biển trời và tình người chân chất. Mùa thu này, bạn sẽ tìm thấy miền đất võ vừa “lạ” vừa “quen” cùng những trải nghiệm hoàn toàn mới.\r\n\r\n“Phát sốt” với khu du lịch Trung Lương\r\n“Phát sốt” với khu du lịch Trung LươngSlideshow\r\nCách thành phố Quy Nhơn khoảng 30km, điểm đến mới toanh này ngay từ khi ra mắt đã thu hút đông đảo du khách đến vui chơi, tận hưởng không khí trong lành của thiên nhiên. Bạn sẽ có những tấm ảnh “check - in” cực chất với những mái lều xanh đỏ nhấp nhô, hàng ghế nghỉ đủ màu hướng về phía biển cùng nắng vàng, cỏ xanh, ghềnh đá tuyệt đẹp. Men theo con đường lát đá, một bờ biển dài tít tắp, cát mịn màng cùng làn nước xanh ngắt bình yên hiện ra làm “mềm lòng” bất cứ ai. Sau khi thỏa sức chụp ảnh, bạn có thể tắm biển, lặn ngắm san hô… và tận hưởng một kỳ nghỉ thảnh thơi thực sự.\r\nNgỡ ngàng Eo Gió\r\nNgỡ ngàng Eo GióSlideshow\r\nNằm trên địa bàn xã Nhơn Lý, cách thành phố Quy Nhơn khoảng 20km, Eo Gió là địa danh mà bất cứ ai cũng muốn ghé thăm. Đứng trên mỏm đá cao nhìn xuống, bạn sẽ thấy một eo biển nhỏ được che chắn bởi dãy núi như vòng tay ôm gọn bãi biển. Nơi ấy, trời – mây - nước và đá giao hòa với nhau tạo nên bức tranh thiên nhiên hữu tình. Nếu kịp đến đây vào lúc sáng sớm, hãy chọn một phiến đá bằng phẳng và ngắm bình minh tuyệt đẹp, lắng nghe sóng biển xô bờ hòa cùng tiếng gió vi vu khu khúc tình ca êm đềm dành tặng khách phương xa.\r\nTheo dấu vua Nguyễn Huệ oai hùng\r\nTheo dấu vua Nguyễn Huệ oai hùngSlideshow\r\nQuy Nhơn địa linh nhân kiệt khiến trái tim ta bồi hồi khi tìm hiểu về sự nghiệp vĩ đại của người anh hùng áo vải Quang Trung - Nguyễn Huệ. Từng di tích gắn liền với cuộc đời của ba anh em nhà Tây Sơn: bảo tàng, giếng nước xưa, cây me 300 tuổi, hay dòng sông Kút thơ mộng soi bóng nước Hầm Hô – căn cứ địa của nghĩa quân Tây Sơn năm xưa… vẫn còn đó. Tất cả vẫn trường tồn mặc cho vật đổi sao dời, như niềm kiêu hãnh bất diệt của người dân đất võ. Đặc biêt, đừng bỏ qua màn trình diễn trống võ hào hùng, sẽ khơi gợi trong mỗi người niềm tự hào khôn xiết về một vùng đất anh hùng. \r\nThưởng thức đặc sản ngon - lành\r\nThưởng thức đặc sản ngon - lànhSlideshow\r\nVề nơi “đất võ, trời văn”, khách phương xa sẽ có cơ hội thưởng thức nhiều món ăn độc đáo, mang đậm hơi thở của biển cả và nền văn hóa bản địa đặc sắc từ ngàn đời nay. Mộc mạc, giản dị mà sáng tạo, quyến rũ… tất cả đã tạo nên một bản hòa tấu đặc sắc, có một không hai của ẩm thực Bình Định. Nổi tiếng nhất là món bánh hỏi lòng heo trứ danh, nem Chợ Huyện, bún chả cá Quy Nhơn, chả ram tôm đất… Đặc biệt, còn vô số hải sản tươi ngon vừa đánh bắt như: tôm, mực, cá, ghẹ... dù hấp, xào hay nướng đều rất ngon miệng, ăn một lần sẽ ghiền!\r\nNghỉ dưỡng 5 sao giá tốt nhất thị trường\r\nNghỉ dưỡng 5 sao giá tốt nhất thị trườngSlideshow\r\nVới sự xuất hiện của resort FLC Quy Nhơn 5*, du khách sẽ có một chuyến du lịch kết hợp hoàn hảo giữa khám phá và nghỉ dưỡng. Điểm khác biệt của resort chính là nét kiến trúc độc đáo theo phong cách Hà Lan hòa quyện cùng thiên nhiên. Chỉ cách vài bước chân, bạn đã thỏa thích tung tăng trên bãi cát trắng, ngắm rừng thông xanh vi vút và vui đùa cùng con sóng. Quan trọng hơn, đây là lần đầu tiên du khách tận hưởng dịch vụ 5* cao cấp tại Quy Nhơn với mức giá tốt nhất thị trường. Hành trình mới lạ, kết hợp khám phá Phú Yên, đi về bằng tàu hỏa tiện nghi hoặc máy bay; lưu trú tại khách sạn, resort 4* - 5* là ưu thế nổi bật của đường tour này. Đây là một trong những sản phẩm mới sẽ “hút” khách trong mùa du lịch cuối năm và Tết Nguyên đán sắp tới.\r\n(Ngồn ảnh: Internet)', 'Không chỉ tự hào là miền đất địa linh nhân kiệt, quê hương của nhiều anh hùng lừng danh, Quy Nhơn còn quyến rũ bởi vẻ đẹp hoang sơ của biển trời và tình người chân chất. Mùa thu này, bạn sẽ tìm thấy miền đất võ vừa “lạ” vừa “quen” cùng những trải nghiệm hoàn toàn mới.\r\n“Phát sốt” với khu du lịch Trung Lương\r\n\r\nCách thành phố Quy Nhơn khoảng 30km', 'full_html'),
	('node', 'article', 0, 11, 11, 'und', 0, 'Khi nhắc đến những thiên đường biển đảo, hẳn bạn sẽ nghĩ ngay tới Maldives hay Hawaii…, tuy nhiên, ngay cạnh Việt Nam, bạn cũng sẽ có những trải nghiệm tương tự tại phố biển Sihanoukville. Đến Sihanoukville, đắm mình giữa biển xanh trong vắt, bạn nhận ra cảnh sắc nơi đây quá đỗi tuyệt vời. Không chỉ xoa dịu cái nóng oi ả miền nhiệt đới, Sihanoukville còn là chốn hẹn hò thú vị để bạn nghỉ ngơi, thưởng thức hải sản hay vui chơi thả ga cùng các môn thể thao hấp dẫn. Về đêm, bạn hãy đến khu phố Tây nhộn nhịp để khám phá các món ăn ngon, rạp chiếu phim, quán bar, cửa hàng lưu niệm… Bạn cũng đừng quên mang theo máy ảnh để ghi lại những khoảnh khắc lãng mạn và ấn tượng nhất!\r\nKoh Rong Samloem - thiên đường du lịch mới\r\nKoh Rong Samloem - thiên đường du lịch mớiSlideshow\r\nNếu bạn đang tìm một bãi biển hay hòn đảo nào đó để “trốn”, lại chẳng muốn xô bồ ở những địa điểm quá quen thuộc như Phuket hay Bali, thì Koh Rong Samloem sẽ là một gợi ý tuyệt vời. Koh Rong Samloem được mệnh danh là “thiên đường bị lãng quên” của đất nước chùa tháp đã làm đắm say biết bao du khách. Nằm cách bờ biển Sihanoukville chỉ chưa đầy 20km, chuyến đi tới Koh Rong Samloem rất dễ dàng và thoải mái với mọi du khách khi chỉ mất 45 phút tàu cao tốc. Nơi đây hấp dẫn bởi nét hoang sơ, nước biển xanh trong màu ngọc bích cùng vẻ đẹp thiên nhiên nguyên vẹn vì chưa chịu sự tác động nhiều của con người. Đón gió từ biển thổi vào mát dịu, ngắm sóng biển với những vạt nắng ngọt ngào như mật, với điểm nhìn từ những ngôi nhà trên cây, quả là những trải nghiệm thú vị chẳng thể nào quên khi ghé thăm Koh Rong Samloem.\r\nKhám phá cao nguyên Bokor - “Sapa ở Campuchia”\r\nKhám phá cao nguyên Bokor -  “Sapa ở Campuchia”Slideshow\r\nMột trong những điểm du lịch không thể bỏ qua khi du khách đến với Campuchia là cao nguyên Bokor. Nằm ở độ cao hơn 1.000m so với mặt nước biển, cao nguyên Bokor được ví như Sapa của Vương quốc Campuchia với mây mù quanh năm che mờ đỉnh núi. Bỏ lại sau lưng những ồn ào, náo nhiệt của cuộc sống, đến với Bokor là du khách đến với màu xanh bạt ngàn của cây rừng, của trời, của biển. Khi hoàng hôn buông xuống, từng đám mây bạc che mờ cả lối đi tạo cho du khách cảm giác như bồng bềnh, lơ lửng mà chỉ cần đưa tay ra là có thể chạm đến trời. Từ cao nguyên Bokor, bạn còn có thể nhìn toàn cảnh Vịnh Thái Lan và đảo Phú Quốc ở phía xa.\r\nHành trình khám phá đất nước chùa tháp Campuchia với cung đường biển độc đáo: Sihanoukville - Koh Rong Samloem - Bokor cùng Vietravel Cà Mau sẽ mang đến cho du khách những trải nghiệm thật sự tuyệt vời. Bạn có muốn thêm dấu chân mình lên những bãi biển trên bản đồ du lịch? Hãy tới Campuchia ngay và luôn nhé!\r\n(Nguồn ảnh: Internet)', 'Khi nhắc đến những thiên đường biển đảo, hẳn bạn sẽ nghĩ ngay tới Maldives hay Hawaii…, tuy nhiên, ngay cạnh Việt Nam, bạn cũng sẽ có những trải nghiệm tương tự tại phố biển Sihanoukville. Đến Sihanoukville, đắm mình giữa biển xanh trong vắt, bạn nhận ra cảnh sắc nơi đây quá đỗi tuyệt vời. Không chỉ xoa dịu cái nóng oi ả miền nhiệt đới, Sihanoukville còn là chốn hẹn hò thú vị để bạn nghỉ ngơi, thưởng thức hải sản hay vui chơi thả ga cùng các môn thể thao hấp dẫn. Về đêm, bạn hãy đến khu phố Tây nhộn nhịp để khám phá các món ăn ngon, rạp chiếu phim, quán bar, cửa hàng lưu niệm… Bạn cũng đừng quên mang theo máy ảnh để ghi lại những khoảnh khắc lãng mạn và ấn tượng nhất!', 'full_html'),
